import React, { useState } from 'react'

const CCustomer =()=>{

    const [custInformation, setCustInformation] = useState({
        name: '',
        dob: '',
        address: '',
        sex: '',
    })

    const handleSubmit=(e)=>{
        e.preventDefault()
        alert('Submitted');
        console.log(custInformation);
    }

    return(
        <div>
            <h1>This is Create Customer</h1>
            <form onSubmit={handleSubmit}>
                <label>
                    Name: 
                    <input type="text" placeholder='Name' onChange={(e)=>{setCustInformation({name:e.target.value})}} />
                </label>
                <input type="submit" value="Submit" />
            </form>
        </div>
    )
}

export default CCustomer;
